import Head from "next/head";

const Admin = () => {
  return (
    <div>
      <Head>
        <title>OJOS | Admin</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <h1 className="page-title">Admin</h1>
    </div>
  );
};

export default Admin;
